import '../style/Login.css'

const Login = () => {
    return ( 
        <>
        <b /><b /><b />
        <div className='container'>
            <div className="card">
                <div className="card-body">
                    <div className="text-center">
                        <img src="https://sotooracademy.com/images/main-logo.png" className="img_width m-3" />
                        <h2 >تسجيل الدخول</h2>
                    </div>
                </div>
            </div>
        </div>
        <b /><b /><b />
        </>
     );
}

export default Login;
